import React from 'react';
import './App.css';

import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams,
  HashRouter
} from "react-router-dom";

const useStyles = makeStyles((theme) => ({
  root: {
    '& > *': {
      margin: theme.spacing(1),
    },
  },
}));

function App() {
  return (
    <div className="App">
      <HomeElement />
    </div>
  );
}

let HomeElement = () => {

  const classes = useStyles();

  return (
    <div className="center">
      <div className="wrapper">
        <Button className="element" variant="outlined" color="primary">Get Current Data</Button>
        <Button className="element" variant="outlined" color="secondary">Change Configuration</Button>

      </div>
    </div>

  );
}



export default App;
